import React from "react";
import { StyleSheet, View, TextInput, TouchableOpacity, Text } from "react-native";
import CustomTextPare from "../common/CustomTextPare";
import CustomText from "../common/CustomText";
import CustomButton from "../common/CustomButton";

function Home() {
    return (
        <View style={Styles.homeContainer}>
            <CustomText TitleText="Hello," />
            <CustomTextPare TitleTextPare="Welcome to the Pinch, Start your Invest-ing now" />



            <TextInput
                style={Styles.input}
                placeholder="Enter Phone no."
                placeholderTextColor="#FAB0A4"
            />
            <View style={{ flexDirection: 'row' }}>

                <CustomTextPare TitleTextPare="Welcome to the Pinch now" />
                <TouchableOpacity><Text>Policy</Text></TouchableOpacity>
                <TouchableOpacity><Text>Terms</Text></TouchableOpacity>
            </View>
            <CustomButton Title="Next" />

        </View>
    );
}

export default Home;

const Styles = StyleSheet.create({
    input: {
        height: 54,
        borderWidth: 1,
        fontSize: 16,
        backgroundColor: '#56423D',
        paddingHorizontal: 15,
        color: 'black',
        marginVertical: 20,
    },
    homeContainer: {
        marginHorizontal: 20,
    }
});
